INSERT INTO exercise (name, description, category) VALUES ('Plate Internally Rotated Rear Delt Fly', 'With plates in either hand, bend your knees with your feet slightly bowed out. Hinge forward with a flat back.
Maintain an overhand grip and internally rotated shoulders.
Raise your arms backward toward the ceiling while maintaining a light band in your elbows.', 'traps_middle') ON CONFLICT (name) DO NOTHING;
